import React from "react";
import "react-step-progress-bar/styles.css";
import { ProgressBar, Step } from "react-step-progress-bar";
import { FaShippingFast} from 'react-icons/fa';
import { MdOutlinePresentToAll} from 'react-icons/md';
import { useState } from 'react';


import '../index.css';



const Progress = () => {
    const [col, setCol] = useState('');
    const [col1, setCol1] = useState('');
    const [col2, setCol2] = useState('');
    const [col3, setCol3] = useState('');
  return (
    <ProgressBar
        filledBackground="red"
        percent={66.6}
      >
        <Step transition="scale">
          {({ accomplished, index }) => (
            <div
              className={`transitionStep ${accomplished ? setCol("red") : null}`}
            >
              <div style={{backgroundColor: col}} className="icon-wrapper">
             <FaShippingFast className="icon-color" />
             </div>
            </div>
          )}
        </Step>
        <Step transition="scale">
          {({ accomplished, index }) => (
            <div
              className={`transitionStep ${accomplished ? setCol("red") : null}`}
            >
              <div className="icon-wrapper">
             <FaShippingFast className="icon-color" />
             </div>
            </div>
          )}
        </Step>
        <Step transition="scale">
          {({ accomplished, index }) => (
            <div
              className={`transitionStep ${accomplished ? setCol("red") : null}`}
            >

             <div className="icon-wrapper">
             <FaShippingFast className="icon-color" />
             </div>
             
            </div>
          )}
        </Step>
        <Step transition="scale">
          {({ accomplished, index }) => (
            <div
              className={`transitionStep ${accomplished ? "accomplished" : null}`}
            >
              <div className="icon-wrapper-f">
             <MdOutlinePresentToAll className="icon-color3" />
             </div>
            </div>
          )}
        </Step>
        
      </ProgressBar>
  )
}

export default Progress
